                # p^q mod 3 = (p mod 3)^q mod 3
                elif digit == 3 or digit == 6 or digit == 9:
                    # Check divisibility by 3
                    if (p % 3) == 0 or ((p % 3) ** q) % 3 == 0:
                        if digit == 3:
                            return 3
                elif digit == 4:
                    # Check if last two digits form a number divisible by 4
                    # p^q mod 100 can help us
                    last_two = (p ** q) % 100
                    if last_two % 4 == 0:
                        return 4
                elif digit == 5:
                    # Check if last digit is 0 or 5
                    if (p ** q) % 10 in [0, 5]:
                        return 5
                elif digit == 7:
                    # For 7, we need to check p^q % 7 == 0
                    # This is expensive but q <= 50, so it's manageable
